import React from 'react';

export default function Navbar() {
	return (
		<div className='navbar'>
			<div className='main-navbar'>
				<h1>Logo</h1>
				<span>
					<img width='30px' src='/static/icons/menu.svg' alt='' />
				</span>
			</div>
			<div className='secondary-navbar'>
				<span>second</span>
			</div>
			<style jsx>
				{`
					.navbar {
						background: white;
						width: 100%;
						position: fixed;
					}
					.main-navbar {
						display: flex;
						justify-content: space-between;
						align-items: center;
						padding: 0 1rem;
					}
					span img {
						color: red;
					}
					.secondary-navbar {
						display: none;
					}
				`}
			</style>
		</div>
	);
}
